interface Entry {
    timestamp: number;
    pointer: number;
}

interface StructType {
    [key: string]: ParamType;
}

interface InstructionEntry extends Entry {
    name: string;
    params: ParamType[];
    returnValue: ParamType;
}

interface FdType {
    fd: number;
    type: string;
    path?: string;
    host?: string;
}

type ParamType = string | null | number | string[] | FdType | StructType;

interface StraceEntry extends Entry {
    message: string;
}

function parse_struct_entry(rawParam: string): { key: string, data: ParamType } {
    const key = rawParam.split('=').find((e, i) => i === 0);
    if (!key) { throw new Error('missing key in struct entry'); }
    const rawData = rawParam.split('=').find((e, i) => i === 1);
    if (!rawData) { throw new Error('missing data in struct entry'); }
    const data = parse_param(rawData);
    return {
        data,
        key,
    };
}

function instanceOfEntry(object: any): object is Entry {
    return 'timestamp' in object && 'pointer' in object;
}

function instanceOfStraceEntry(object: any): object is StraceEntry {
    return instanceOfEntry(object) && 'message' in object;
}

function instanceOfInstructionEntry(object: any): object is InstructionEntry {
    return instanceOfEntry(object) && 'name' in object && 'params' in object && 'returnValue' in object;
}

function parse_struct_entries(rawParam: string): StructType {
    const obj = {};
    rawParam.slice(1, -1).split(', ').map(parse_struct_entry).forEach((e) => obj[e.key] = e.data);
    return obj;
}

function parse_fd(line: string): FdType {
    const fd = parseInt(line, 10);
    const type = line.split('<').find((e, i) => i === 1);
    const path: string | undefined = line.split('<').find((e, i) => i === 1);
    return {
        fd,
        path,
        type: '???',
    };
}

function parse_params(rawParams: string[]): ParamType[] {
    const params: ParamType[] = [];
    for (let i = 0; i < rawParams.length; i++) {
        let param: ParamType | null = null;
        if (rawParams[i].startsWith('{')) {
            const beginIndex = i;
            const endIndex = rawParams.slice(beginIndex).findIndex((e) => e.endsWith('}')) + 1;
            i = endIndex;
            param = parse_param(rawParams.splice(beginIndex, endIndex).join(', '));
        } else if (rawParams[i].startsWith('(')) {
            const beginIndex = i;
            const endIndex = rawParams.slice(beginIndex).findIndex((e) => e.endsWith(')')) + 1;
            i = endIndex;
            param = rawParams.splice(beginIndex, endIndex).join(', ');
        } else {
            // TODO WTF le type change ici
            param = parse_param(rawParams[i]);
        }
        params.push(param);
    }
    return params;
}

function parse_param(rawParam: string): ParamType {
    if (rawParam === undefined) { return 'WHATTTTTT'; }
    // console.log('->', rawParam)
    if (rawParam.match(/^-*[0-9]+$/)) {
        // console.log('parse Int')
        return parseInt(rawParam, 10);
    } else if (rawParam.match(/^0x[0-9]+$/)) {
        // console.log('parse Hex')
        return parseInt(rawParam, 16);
    } else if (rawParam === 'NULL') {
        // console.log('parse NULL')
        return null;
    } else if (rawParam.match(/^-*[0-9]+</)) {
        return parse_fd(rawParam);
    } else if (rawParam.match(/^-*[0-9]+/)) {
        // TODO parse fd
        // console.log('parse FD')
        return parseInt(rawParam, 10);
    } else if (rawParam.startsWith('"')) {
        if (rawParam.endsWith('...')) {
            // console.log('parse Long string')
            // Todo manage really long line
            return '...';
        } else {
            // console.log('parse string', rawParam)
            return rawParam.slice(1, -1);
        }
    } else if (rawParam.startsWith('{')) {
        // TODO parse struct
        // console.log('parse Struct')
        return parse_struct_entries(rawParam);
    } else if (rawParam.includes('|')) {
        // console.log('parse OR')
        return rawParam.split('|');
    } else if (rawParam.startsWith('[')) {
        // console.log('parse ARRAY')
        return rawParam.slice(1, -1).split(' ');
    }
    // console.log('not parse', rawParam)
    return rawParam;
}

function parse_instruction_entry(entry: Entry, line: string): InstructionEntry {
    const name = line.split('(').find((e, i) => i === 0);
    if (!name) { throw new Error('syscall have no name'); }
    const rawReturnValue = line.split(' = ').find((e, i, a) => i === (a.length - 1));
    if (!rawReturnValue) { throw new Error('syscall have no return value'); }
    const returnValue = parse_param(rawReturnValue);
    const rawParams = line.slice(name.length + 1, -(rawReturnValue.length + 4)).split(', ');
    const params = parse_params(rawParams);
    return {
        ...entry,
        name,
        params,
        returnValue,
    };
}

function parse_strace_entry(entry: Entry, line: string): StraceEntry {
    const message = line.slice(4, -4);
    return {
        ...entry,
        message,
    };
}

function parse_line(line: string): InstructionEntry | StraceEntry {
    const rawTimestamp = line.split(' ').find((e, i) => i === 0);
    if (!rawTimestamp) { throw new Error('cant find timestamp'); }
    const timestamp = parseFloat(rawTimestamp);
    const rawPointer = line.split(' ').find((e, i) => i === 1);
    if (!rawPointer) { throw new Error('cant find pointer'); }
    const pointer = parseInt(rawPointer.slice(1, -1), 16);
    const instruction = line.split(' ').filter((e, i) => i >= 2).join(' ');

    if (isNaN(pointer)) {
        return parse_strace_entry({ timestamp, pointer }, instruction);
    }
    return parse_instruction_entry({ timestamp, pointer }, instruction);
}

function parse_lines(lines: string[]): Array<InstructionEntry | StraceEntry> {
    return lines.map((l) => parse_line(l));
}
